import {
  Container,
  Row,
  Col,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Img from "react-image";
import LazyLoad from "react-lazyload";
import Collapsible from "react-collapsible";
import YouTube from "react-youtube";

// Common
import BetaMessage from "../common/BetaMessage";
import Head from "next/head";

// Layout
import Layout from "../components/Layout";

const opts = {
  height: "300px",
  width: "100%",
  playerVars: {
    autoplay: 0
  }
};

const Meetings = props => (
  <Layout>
    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Meetings</BreadcrumbItem>
      </Breadcrumb>

      <Row>
        <Col sm={12} md={8} lg={8}>
          <Card>
            <CardBody>
              <CardTitle>Online Group Meetings</CardTitle>
            </CardBody>
            <CardFooter></CardFooter>
          </Card>
        </Col>
        <Col sm={4} md={4} lg={4}>
          <YouTube opts={opts} videoId="vFhAEoCF7jg" />
          <br />
          <YouTube opts={opts} videoId="HqncX7RE0wM" />
          <Card>
            <CardBody>
              <CardTitle></CardTitle>
            </CardBody>
            <CardFooter></CardFooter>
          </Card>
        </Col>
      </Row>
    </Container>
  </Layout>
);

export default Meetings;
